import React from "react";
import "../App.css";
import { Tabs, TabList, Tab } from '@chakra-ui/react'
import { extendTheme } from "@chakra-ui/react";

// Extend the default Chakra UI theme with your custom styles
const theme = extendTheme({
  styles: {
    global: {
      // Add your custom CSS rules here
      "Tab:hover": {
        textDecoration: "underline",
        textDecorationColor: "blue",
        textDecorationThickness: "3px"
      }
    }
  }
});

function HeaderBar() {
    return (
      <Tabs position='relative' variant='unstyled' theme={theme}>
        <TabList>
          <Tab > One</Tab>
        <Tab _hover={{ textDecoration: 'underline', textDecorationColor: 'blue', textDecorationThickness: '2px' }}>Two</Tab>
          <Tab _hover={{ textDecoration: 'underline', textDecorationColor: 'blue', textDecorationThickness: '2px' }}>Three</Tab>
        </TabList>
      </Tabs>
    );
    }

export default HeaderBar;
